import {CREATE_ROOM} from "../actions";

const initialState = {
    room: 0
}

const createRoomButton = (state = initialState, action) => {
    switch (action.type) {
        case CREATE_ROOM:
            state.room = 9;
            return state.header.room;

        default:
            return state;
    }
}

export default createRoomButton;
